        async function fetchData() {
           setJobs([...await JoblyApi.getJobs()]) 
        }
        fetchData()
    },[])
    console.log(jobs)

    return (
        <div>
            {jobs.map(j => <JobCard job={j}/>)}
        </div>
    )
}

export default Jobs
